const initialState = {
    check: false
  }
 export const check = (state = initialState, action) => {
      switch (action.type){
          case 'CHECK_BOX':
              return {
                check: !check,
                id: action.id,
                text: action.text,
                ...state,
              }
          default:
              return state
      }
  }

  export default check
